import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

interface Store {
  store_id: number;
  name: string;
  store_description: string;
  address: string;
  phone_number: string;
  store_url: string;
  store_img: string;
  reference: string;
  tags?: Tag[];
}

interface Tag {
  id: number;
  name: string;
}

interface FacilityTag {
  id: number;
  name: string;
}

const DogRunStoreList: React.FC = () => {
  const { prefectureId } = useParams<{ prefectureId: string }>();
  const [store, setStore] = useState<Store[]>([]);
  const [tags, setTags] = useState<Tag[]>([]);
  const [tagsFacility, setTagsFacility] = useState<FacilityTag[]>([]);
  const [selectedPrefecture, setSelectedPrefecture] = useState<string>("");
  const [selectedTagIds, setSelectedTagIds] = useState<number[]>([]);
  const [selectedFacilityTagIds, setSelectedFacilityTagIds] = useState<
    number[]
  >([]);

  // 店舗データを取得する
  useEffect(() => {
    const fetchStores = async () => {
      try {
        const response = await fetch(
          `http://localhost:5003/stores/list/${prefectureId}`
        );
        const data = await response.json();
        setStore(data);
      } catch (error) {
        console.error("店舗データの取得に失敗しました:", error);
      }
    };
    fetchStores();
  }, [prefectureId]);

  // タグデータの取得
  useEffect(() => {
    const fetchTags = async () => {
      try {
        const response = await fetch("http://localhost:5003/tags");
        const data: Tag[] = await response.json();
        setTags(data);
      } catch (error) {
        console.error("タグ情報の取得に失敗しました:", error);
      }
    };
    fetchTags();
  }, []);

  // 設備タグデータの取得
  useEffect(() => {
    const fetchTagsFacility = async () => {
      try {
        const response = await fetch("http://localhost:5003/tags_facility");
        const data: FacilityTag[] = await response.json();
        setTagsFacility(data);
      } catch (error) {
        console.error("設備タグ情報の取得に失敗しました:", error);
      }
    };
    fetchTagsFacility();
  }, []);

  // タグ選択のハンドリング
  const handleTagClick = (tagId: number) => {
    setSelectedTagIds((prevSelectedTagIds) =>
      prevSelectedTagIds.includes(tagId)
        ? prevSelectedTagIds.filter((id) => id !== tagId)
        : [...prevSelectedTagIds, tagId]
    );
  };

  // 設備タグ選択のハンドリング
  const handleFacilityTagClick = (facilityTagId: number) => {
    setSelectedFacilityTagIds((prevSelectedFacilityTagIds) =>
      prevSelectedFacilityTagIds.includes(facilityTagId)
        ? prevSelectedFacilityTagIds.filter((id) => id !== facilityTagId)
        : [...prevSelectedFacilityTagIds, facilityTagId]
    );
  };

  // 各都道府県の表示
  useEffect(() => {
    const prefectureNames: { [key: string]: string } = {
      "1": "北海道",
      "13": "東京",
      "14": "神奈川",
      "23": "愛知",
      "26": "京都",
      "27": "大阪",
      "28": "兵庫",
    };
    setSelectedPrefecture(
      prefectureNames[prefectureId ?? ""] || "ドッグラン情報がありません"
    );
  }, [prefectureId]);

  const isPrefectureSupported =
    selectedPrefecture !== "ドッグラン情報がありません";

  return (
    <div
      style={{
        textAlign: "center",
        padding: "20px",
        backgroundColor: "#FAF3E0",
      }}
    >
      {isPrefectureSupported ? (
        <>
          <h2>{selectedPrefecture}のドッグラン</h2>
          <p
            style={{
              fontSize: "14px",
              marginBottom: "20px",
              fontWeight: "bold",
            }}
          >
            条件を絞り込む
          </p>
          <div
            style={{
              display: "flex",
              flexWrap: "wrap",
              justifyContent: "center",
              gap: "10px",
            }}
          >
            {tags.map((tag) => (
              <button
                key={tag.id}
                onClick={() => handleTagClick(tag.id)}
                style={{
                  backgroundColor: selectedTagIds.includes(tag.id)
                    ? "#D1E8E1"
                    : "#FFF",
                  color: "#333",
                  padding: "10px 15px",
                  border: "1px solid #333",
                  borderRadius: "20px",
                  cursor: "pointer",
                  fontSize: "14px",
                }}
              >
                {tag.name}
              </button>
            ))}
          </div>
          <p
            style={{
              fontSize: "14px",
              marginBottom: "20px",
              fontWeight: "bold",
            }}
          >
            設備
          </p>
          <div
            style={{
              display: "flex",
              flexWrap: "wrap",
              justifyContent: "center",
              gap: "10px",
            }}
          >
            {tagsFacility.map((facility) => (
              <button
                key={facility.id}
                onClick={() => handleFacilityTagClick(facility.id)}
                style={{
                  backgroundColor: selectedFacilityTagIds.includes(facility.id)
                    ? "#D1E8E1"
                    : "#FFF",
                  color: "#333",
                  padding: "10px 15px",
                  border: "1px solid #333",
                  borderRadius: "20px",
                  cursor: "pointer",
                  fontSize: "14px",
                }}
              >
                {facility.name}
              </button>
            ))}
          </div>
          {store && store.length > 0 ? (
            store.map((storeItem) => (
              <div key={storeItem.store_id} style={{ marginBottom: "30px" }}>
                <img
                  src={storeItem.store_img}
                  alt={storeItem.name}
                  style={{ width: "400px", height: "300px" }}
                />
                <p>{storeItem.name}</p>
                <p>引用: Photostudio S CO.LTD</p>
                <p>{storeItem.store_description}</p>
                <p>住所: {storeItem.address}</p>
                <p>電話: {storeItem.phone_number}</p>
                <a
                  href={storeItem.store_url}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  お店の詳細
                </a>
              </div>
            ))
          ) : (
            <h2>ドッグラン情報がありません</h2>
          )}
        </>
      ) : (
        <h2>ドッグラン情報がありません</h2>
      )}
    </div>
  );
};

export default DogRunStoreList;
